.point {
    position: absolute;
    width: 50px;
    height: 50px;
    background: url("./icons/icons_sat.svg") no-repeat;
    background-size: cover; 
    z-index: 2;
}

.point_track{
    position: absolute;
    z-index: 1;
    border-radius: 50%;
    width: 8px;
    height: 8px;
    background: #ff8000;
}

.point_locate{
    position: absolute;
    width: 30px;
    height: 30px;
    background: url("./icons/locator.svg") no-repeat;
    background-size: cover; 
    /* border-radius: 50%;
    background: red; */
    z-index: 1;
}

/* Применение анимации при добавлении */
.points-transition-enter-active {
    animation: grow-shrink 2s ease-in-out;
}

.points-transition-leave-active {
    animation: grow-shrink 2s reverse ease-in-out;
}

.point:hover {
    cursor: pointer;
    width: 60px;
    height: 60px
}

.map_wrapper{
    max-width: 100%;
    min-width: 500px;
    display: flex;
    align-items: center;
}

.wrapper{
    position: relative;
}

.wrapper svg{
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
}

.continent{
    fill: none;
    stroke: rgb(3, 17, 26);
    stroke-width: 10px;
    cursor: pointer;
    pointer-events: all;
}

.continent:hover{
    animation: highlightContinent 2s linear infinite;
}

@keyframes highlightContinent {
    0%{
        stroke: #000;
    }
    50%{
        stroke: #fff;
    }
    100%{
        stroke: #000;
    }
}

@font-face {
    font-family: 'Journal Sans' ;
    font-style: Italic;
    font-weight: 400;
    src: url('/src/components/Fonts/JournalSansItalic.ttf')
}

@font-face {
    font-family: 'Berlin Sans' ;
    font-style: bold;
    font-weight: 700;
    src: url('/src/components/Fonts/Berlin_Sans_FB_Demi_Bold.ttf')
}

.tooltip{
    position: absolute;
    left: 0;
    top: 0;
    padding: 5px;
    background:  #bbe1ea;
    border-radius: 10px;
    box-shadow: 0 0 10px rgba(0,0,0,0.3);
    display: none;
    font-family: 'Journal Sans', sans-serif;
    font-style: italic;
    color: #17364b;
    font-size: 18px;
}
</style>